import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import {
    Grid,
    Typography,
    Button,
} from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Intro from '../../components/Home/Intro';

import BG from './imgs/reset.jpg';
import TopRight from './imgs/1x/TopRight.png';

const useStyles = makeStyles((theme) => ({
    container: {
        backgroundImage: `url(${BG})`,
        backgroundSize: 'cover',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
    },
    introContainer: {
        padding: 20,
        color: 'white',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexWrap: 'wrap',
    },
    logo: {
        width: '70%',
        height: 'auto',
    },
    header: {
        margin: '20px 0px',
    },
    button: {
        margin: '40px 0px',
        padding: 15,
        color: '#0000a2',
        background: 'white'
    },
    div: {
        height: 160,
        backgroundImage: `url(${TopRight})`,
        backgroundSize: 'cover',
    },
    tech: {
        height: '150vh',
        backgroundColor: 'white',
    },
}));

const Home = () => {

    const classes = useStyles();

    return (
        <Grid className={classes.container} container>

            <Nav />

            <Intro />

            <Grid className={classes.div} item xs={12}></Grid>
            <Grid className={classes.tech} item xs={12}>


            </Grid>

        </Grid>
    );
};

export default Home;
